from django.urls import pathfrom django.contrib.auth.views import LoginView,LogoutViewfrom .views import UserList, signupapp_name = "accounts"urlpatterns = [    path('user/list/', UserList.as_view(), name = 'user_list'),    path('login/',LoginView.as_view(template_name = 'accounts/login.html'), name = 'login'),    path('logout/',LogoutView.as_view(template_name = 'accounts/logout.html'), name = 'logout'),    path('signup/',signup,name='signup'),]